insert  into `es_article`(`id`,`title`,`alias`,`keywords`,`summary`,`content`,`source`,`copySite`,`copyURL`,`author`,`addedBy`,`editor`,`addedDate`,`editedDate`,`status`,`type`,`contribution`,`views`,`sticky`,`order`,`link`,`css`,`js`,`lang`) values (1,'FBBM2.0,极致体验的融合超宽带','','','随着科技的逐步发达极致体验业务也成为重要的成长因素的逐步发达极致体的逐步发达。','随着科技的逐步发达极致体验业务也成为重要的成长因素的逐步发达极致体的逐步发达。','original','','','admin','admin','admin','2016-01-29 11:31:00','2016-01-29 12:37:00','normal','article',0,36,'1',0,'','','','zh-cn'),(2,'2016年NVKDJFVV科技峰会即将举行','','','随着科技的逐步发达极致体验业务也成为重要的成长因素的逐步发达极致体的逐。','<span>随着科技的逐步发达极致体验业务也成为重要的成长因素的逐步发达极致体的逐。</span><br />\r\n<br />','original','','','admin','admin','admin','2016-01-29 11:31:00','2016-01-29 12:30:18','normal','article',0,30,'1',0,'','','','zh-cn'),(27,'原始创新，SSC1643电力线载波芯片荣获中国芯“最佳市场表现产品”奖','','','上海东软载波微电子有限公司的电力线载波芯片SSC1643以优秀的市场品牌表现和对工业经济发展、电力线载波技术做出的突出贡献，被活动评选主办方联合授予第十届“中国芯-最佳市场表现产品”。','<div style=\"margin-left:auto;color:#666666;font-family:Arial;\">&nbsp; &nbsp; &nbsp; &nbsp;11月26日由工业和信息化部电子信息司、厦门市人民政府指导，工业和信息化部软件与集成电路促进中心（CSIP）主办，厦门火炬高技术产业开发区管理委员会、厦门经济和信息化局、紫光集团有限公司协办的2015中国集成电路产业促进大会在厦门成功召开。本届大会主题为“推动整机与芯片联动，打造集成电路大产业链”。</div>\n<div style=\"margin-left:auto;color:#666666;font-family:Arial;\">上海东软载波微电子有限公司的电力线载波芯片SSC1643以优秀的市场品牌表现和对工业经济发展、电力线载波技术做出的突出贡献，被活动评选主办方联合授予第十届“中国芯-最佳市场表现产品”。<span style=\"vertical-align:middle;font-size:10.5pt;font-family:\'Times New Roman\';\">&nbsp;<br />\n</span><img height=\"215\" width=\"650\" alt=\"\\\" src=\"http://www.essemi.com/uploadfile/2015/1202/20151202053340257.jpg\" /><br />\n&nbsp;</div>\n<div align=\"left\" style=\"margin-left:auto;color:#666666;font-family:Arial;\">中国电网的复杂环境，上海东软载波微电子通过对国内电网的深入研究和大量的实验以及电力线载波通信的关键技术——解决电力噪声极其复杂环境下，如何调制解调并处理通信信号的技术难关。提升并克服国内外同类产品的优缺点。SSC1643电力线载波通信的芯片一款高集成度的电力线载波通信芯片，内部集成BFSK/DBPSK&nbsp;收发器。该芯片采用数模混合集成电路设计，发挥模拟电路对微弱信号的增益和低噪声（相对于数字量化噪声）特性；采用自适应滤波设计，在10k~500kHz&nbsp;内，载波通信频率可任意编程设置；信号动态范围80dB；集成高性能的增益控制的低噪声放大器LNA&nbsp;和低中频信号放大PGA；充分利用DSP&nbsp;的信号处理能力，内部高度集成BFSK及DBPSK调制解调模块，可以与目前国内外主要的窄带低速电力线载波方案作兼容设计。另外，SSC1643芯片可以作为电力物联网的接入模块，在智能家居产品中有广泛的应用前景。</div>\n<div style=\"margin-left:auto;color:#666666;font-family:Arial;\">主要表现在：</div>\n<div style=\"margin-left:auto;color:#666666;font-family:Arial;\">1) 增加LNA，降低前级AFE的噪声系数；</div>\n<div style=\"margin-left:auto;color:#666666;font-family:Arial;\">2) 高集成度AFE结构，降低系统BOM成本；</div>\n<div style=\"margin-left:auto;color:#666666;font-family:Arial;\">3) 支持多种调制、解调方式，适应不同的标准；</div>\n<div style=\"margin-left:auto;color:#666666;font-family:Arial;\">4) 高带宽，支持500K以下任意频率可调；</div>\n<div style=\"margin-left:auto;color:#666666;font-family:Arial;\">5) 支持软硬件协同的扩频算法实现；</div>\n<div style=\"margin-left:auto;color:#666666;font-family:Arial;\">6) SOC芯片，丰富的外设和ARM CPU，降低系统开发难度。<br />\n&nbsp;<img height=\"234\" width=\"650\" alt=\"\\\" src=\"http://www.essemi.com/uploadfile/2015/1202/20151202053423468.jpg\" /><br />\n&nbsp;</div>\n<div style=\"margin-left:auto;color:#666666;font-family:Arial;\">“中国芯”活动开展十年以来，不论是参与企业还是参与产品都很好展示了中国芯片设计业的发展水平。其中，累计共有来自全国各地300多家集成电路设计企业的500多款优秀芯片产品参与到评选活动中。近四年来，参选芯片共申报专利6548项，其中获得授权专利2152项，平均每款芯片申请专利16项，获得授权4项。我司不断坚持研发具有核心自主知识产权的产品，在参选芯片的专利数量和质量上逐年保持上升。</div>\n<div style=\"margin-left:auto;color:#666666;font-family:Arial;\">“中国芯”评选活动作为本土IC设计人自己的产业公共品牌，饱含了国家对集成电路行业的重视和支持，以及所有同行十年来的智慧和汗水。而近几年国内涌现出来的一大批优秀企业，预示着中国集成电路行业的崛起。“中国芯”工程将在下一个十年里，配合国家产业战略和产业升级要求，继续提升服务与品牌价值，为实现“中国芯中国赢”而继续努力。</div>','original','','','admin','admin','admin','2016-03-06 21:31:00','2016-03-06 21:33:38','normal','article',0,29,'1',0,'','','','zh-cn'),(4,'集成开发环境软件iDesigner 版本升级V4.0.2.90','','','集成开发环境软件iDesigner 版本升级V4.0.2.90','集成开发环境软件iDesigner 版本升级V4.0.2.90','original','','','admin','admin','','2016-02-01 17:12:00','2016-02-01 17:12:52','normal','article',0,45,'0',0,'','','','zh-cn'),(5,'产品HR7P275的数据手册、应用笔记改版 ','','','产品HR7P275的数据手册、应用笔记改版 ','产品HR7P275的数据手册、应用笔记改版&nbsp;','original','','','admin','admin','','2016-02-01 17:13:00','2016-02-01 17:13:16','normal','article',0,33,'0',0,'','','','zh-cn'),(6,'C编译器工具链(Cortex-M0) Dorado_v1.0.0.2','','','C编译器工具链(Cortex-M0) Dorado_v1.0.0.2','C编译器工具链(Cortex-M0) Dorado_v1.0.0.2','original','','','admin','admin','','2016-02-01 17:13:00','2016-02-01 17:13:32','normal','article',0,27,'0',0,'','','','zh-cn'),(7,'产品HR7P169_170应用笔记、模块例程升级 V1.7','','','产品HR7P169_170应用笔记、模块例程升级 V1.7','产品HR7P169_170应用笔记、模块例程升级 V1.7','original','','','admin','admin','','2016-02-01 17:13:00','2016-02-01 17:13:44','normal','article',0,21,'0',0,'','','','zh-cn'),(8,'产品HR7P275的数据手册、应用笔记改版 ','','','产品HR7P275的数据手册、应用笔记改版 ','产品HR7P275的数据手册、应用笔记改版&nbsp;','original','','','admin','admin','','2016-02-01 17:13:00','2016-02-01 17:13:58','normal','article',0,20,'0',0,'','','','zh-cn'),(9,'冰箱','','','','<table class=\"table table-kindeditor ke-zeroborder table-borderless \" style=\"width:80%;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\"><tbody><tr><td width=\"50%\"><p style=\"vertical-align:baseline;\"><br />\r\n</p>\r\n<img src=\"/data/upload/201603/f_033aebbbfc45244ab650afca2d77d872.jpg\" alt=\"\" /><br />\r\n</td>\r\n<td><p style=\"vertical-align:baseline;\">功能说明：</p>\r\n<div style=\"vertical-align:baseline;\"><br />\r\n</div>\r\n<br />\r\n<p style=\"vertical-align:baseline;\">特征说明：</p>\r\n<div style=\"vertical-align:baseline;\"><br />\r\n</div>\r\n<p style=\"vertical-align:baseline;\">&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>原理框图：</strong></p>\r\n<p><img src=\"/data/upload/201603/f_d6c422d8efe2e8d6bd990bf599a5ca26.jpg\" alt=\"\" /></p>','original','','','admin','admin','admin','2016-02-24 11:04:00','2016-03-27 14:18:31','normal','article',0,33,'0',0,'','','','zh-cn'),(10,'小家电','','','','小家电小家电','original','','','admin','admin','','2016-02-24 11:21:00','2016-02-24 11:21:20','normal','article',0,5,'0',0,'','','','zh-cn'),(11,'小家电','','','','小家电小家电','original','','','admin','admin','','2016-02-24 11:21:00','2016-02-24 11:21:42','normal','article',0,7,'0',0,'','','','zh-cn'),(19,'仿真器软件下载','','','','1.0','original','','','admin','admin','admin','2016-02-28 17:59:00','2016-03-06 21:40:56','normal','article',0,2,'0',0,'','','','zh-cn'),(28,'软件名称','','','','1.0','original','','','admin','admin','','2016-03-06 21:48:00','2016-03-06 21:49:04','normal','article',0,14,'0',0,'','','','zh-cn'),(22,'原始创新，SSC1643电力线载波芯片荣获中国芯“最佳市场表现产品”奖','','','原始创新，SSC1643电力线载波芯片荣获中国芯“最佳市场表现产品”奖','11月26日由工业和信息化部电子信息司、厦门市人民政府指导，工业和信息化部软件与集成电路促进中心（CSIP）主办，厦门火炬高技术产业开发区管理委员会、厦门经济和信息化局、紫光集团有限公司协办的2015中国集成电路产业促进大会在厦门成功召开。本届大会主题为“推动整机与芯片联动，打造集成电路大产业链”。<br />\n上海东软载波微电子有限公司的电力线载波芯片SSC1643以优秀的市场品牌表现和对工业经济发展、电力线载波技术做出的突出贡献，被活动评选主办方联合授予第十届“中国芯-最佳市场表现产品”。&nbsp;<br />\n<br />\n<br />\n中国电网的复杂环境，上海东软载波微电子通过对国内电网的深入研究和大量的实验以及电力线载波通信的关键技术——解决电力噪声极其复杂环境下，如何调制解调并处理通信信号的技术难关。提升并克服国内外同类产品的优缺点。SSC1643电力线载波通信的芯片一款高集成度的电力线载波通信芯片，内部集成BFSK/DBPSK 收发器。该芯片采用数模混合集成电路设计，发挥模拟电路对微弱信号的增益和低噪声（相对于数字量化噪声）特性；采用自适应滤波设计，在10k~500kHz 内，载波通信频率可任意编程设置；信号动态范围80dB；集成高性能的增益控制的低噪声放大器LNA 和低中频信号放大PGA；充分利用DSP 的信号处理能力，内部高度集成BFSK及DBPSK调制解调模块，可以与目前国内外主要的窄带低速电力线载波方案作兼容设计。另外，SSC1643芯片可以作为电力物联网的接入模块，在智能家居产品中有广泛的应用前景。<br />\n主要表现在：<br />\n1) 增加LNA，降低前级AFE的噪声系数；<br />\n2) 高集成度AFE结构，降低系统BOM成本；<br />\n3) 支持多种调制、解调方式，适应不同的标准；<br />\n4) 高带宽，支持500K以下任意频率可调；<br />\n5) 支持软硬件协同的扩频算法实现；<br />\n6) SOC芯片，丰富的外设和ARM CPU，降低系统开发难度。<br />\n&nbsp;<br />\n&nbsp;<br />\n“中国芯”活动开展十年以来，不论是参与企业还是参与产品都很好展示了中国芯片设计业的发展水平。其中，累计共有来自全国各地300多家集成电路设计企业的500多款优秀芯片产品参与到评选活动中。近四年来，参选芯片共申报专利6548项，其中获得授权专利2152项，平均每款芯片申请专利16项，获得授权4项。我司不断坚持研发具有核心自主知识产权的产品，在参选芯片的专利数量和质量上逐年保持上升。<br />\n“中国芯”评选活动作为本土IC设计人自己的产业公共品牌，饱含了国家对集成电路行业的重视和支持，以及所有同行十年来的智慧和汗水。而近几年国内涌现出来的一大批优秀企业，预示着中国集成电路行业的崛起。“中国芯”工程将在下一个十年里，配合国家产业战略和产业升级要求，继续提升服务与品牌价值，为实现“中国芯中国赢”而继续努力。<br />','original','','','admin','admin','','2016-03-05 12:32:00','2016-03-05 13:20:18','normal','article',0,1,'0',0,'','','','zh-cn'),(24,'车载HID灯安定器','','','','<table class=\"table table-kindeditor ke-zeroborder table-borderless \" style=\"width:80%;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\"><tbody><tr><td width=\"50%\"><p style=\"vertical-align:baseline;\"><img src=\"/data/upload/201603/f_1e31a27963b442