span>处理器，支持大数据快速传输以及桶形移位操作<span></span></p>\n<p class=\"MsoNormal\">》程序存储器：<span>24KB(OTP)</span></p>\n<p class=\"MsoNormal\">》数据存储器：<span>2KB(SRAM)</span></p>\n<p class=\"MsoNormal\">》超低功耗休眠模式，最低功耗小于<span>400nA</span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\"><b>技术参数：<span></span></b></p>\n<p class=\"MsoNormal\">》国密算法<span>SM3</span>口令计算时间：<span>&lt;30ms</span></p>\n<p class=\"MsoNormal\">》工作电压：<span>2.0V&nbsp;~&nbsp;3.6V</span></p>\n<p class=\"MsoNormal\">》工业级工作温度：<span>-40</span>℃<span>&nbsp;~&nbsp;85</span>℃<span></span></p>\n<p class=\"MsoNormal\">》高可靠性：<span>ESD&nbsp;(HBM)&gt;</span>±<span>4KV</span></p>\n<p class=\"MsoNormal\">》高速工作电流（<span>2MHz</span>）：<span>240uA</span></p>\n<p class=\"MsoNormal\">》休眠电流：<span>360nA</span><span style=\"line-height:1.53846;background-color:transparent;\"></span></p>\n<p><br />\n</p>\n<p><br />\n</p>\n</td>\n</tr>\n<tr><td><br />\n</td>\n<td><p class=\"MsoNormal\"><br />\n</p>\n</td>\n</tr>\n</tbody>\n</table>','',1,',1,8,',2,10,'product','0','',0,0,'','2016-01-26 17:45:38',0,0,'','0','zh-cn'),(10,'我想','','','','',0,',10,',1,10,'article','0','',0,0,'','2016-01-28 12:33:34',0,0,'','0','zh-cn'),(11,'8位 MCU','','','<table class=\"table table-kindeditor ke-zeroborder table-borderless \" style=\"width:100%;\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr><td><p style=\"vertical-align:baseline;\"><img title=\"\" alt=\"\" src=\"/data/upload/201603/f_2cd083eed5ed58257697c40c687808b1.jpg\" height=\"410\" width=\"200\" align=\"\" /></p>\n</td>\n<td><p style=\"vertical-align:baseline;\"><b>应用领域：</b></p>\n<p class=\"MsoNormal\">消费电子、小家电、家电、工业控制、仪器仪表等领域<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\"><b>应用优势：<span> </span></b></p>\n<p class=\"MsoNormal\">》<span>8</span>位通用型<span>MCU</span>，<span>C </span>编译效率高<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:-10.5pt;margin-left:10.5pt;\">》内嵌存储资源及外设资源，可满足各行业对产品系统复杂度及系统功耗的开发需求<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:-10.5pt;margin-left:10.5pt;\">》高可靠硬件代码保护机制，有效保护用户程序<span></span></p>\n<p class=\"MsoNormal\">》工业级标准，抗干扰能力强<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\"><b>技术参数：<span> </span></b></p>\n<p class=\"MsoNormal\" style=\"text-indent:-10.5pt;margin-left:10.5pt;\">》自主研发<span>8</span>位<span>CPU</span>内核，<span>HR7P</span>指令集，<span>2T</span>架构<span></span></p>\n<p class=\"MsoNormal\">》程序存储器：<span>2KB(OTP)~64KB(FLASH)</span></p>\n<p class=\"MsoNormal\" style=\"text-indent:-10.5pt;margin-left:10.5pt;\">》数据存储器：<span>512B~8KB(SRAM)</span>，<span>512B EEPROM</span></p>\n<p class=\"MsoNormal\" style=\"text-indent:-10.5pt;margin-left:10.5pt;\">》集成外设丰富：多路<span>PWM</span>，多路<span>UART</span>，<span>I2C</span>，<span>LCDC</span>，<span>12-bit ADC</span>等低功耗，待机功耗：<span>3uA/5uA/20uA</span></p>\n<p class=\"MsoNormal\">》工作电压：<span>2.1V~5.5V</span><span style=\"line-height:1.5384;background-color:transparent;\"></span></p>\n<p><br />\n</p>\n</td>\n</tr>\n<tr><td colspan=\"2\"><p style=\"text-align:center;\"><img alt=\"\" src=\"/data/upload/201603/f_2e3d786f348712b139dd3e000e2cab9c.jpg\" /></p>\n</td>\n</tr>\n</tbody>\n</table>','',4,',1,4,11,',3,10,'product','0','',0,0,'','2016-01-28 16:39:37',0,0,'','0','zh-cn'),(12,'32位','','','<p><table style=\"width:80%;\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\" class=\"table table-kindeditor ke-zeroborder table-borderless \"><tbody><tr><td><p style=\"vertical-align:baseline;\"><img src=\"/data/upload/201603/f_6ee775cf97c8233f600cc13f86be1499.jpg\" alt=\"\" width=\"200\" height=\"479\" title=\"\" align=\"\" /></p>\n</td>\n<td><p style=\"vertical-align:baseline;\"><b>应用领域：</b></p>\n<p class=\"MsoNormal\">家电、智能家居、仪器仪表、液晶面板控制器、<span> LCD</span>显示控制板、工业控制<span></span></p>\n<p class=\"MsoNormal\"><b><span>&nbsp;</span></b></p>\n<p class=\"MsoNormal\"><b>应用优势：<span> </span></b></p>\n<p class=\"MsoNormal\">》工业级标准，抗干扰能力强<span></span></p>\n<p class=\"MsoNormal\" style=\"margin-left:10.5pt;text-indent:-10.5pt;\">》<span>32</span>位通用型<span>MCU</span>，具有液晶驱动、高精度<span></span></p>\n<p class=\"MsoNormal\" style=\"margin-left:10.5pt;text-indent:-10.5pt;\">》<span>RTC</span>、支持<span>IC</span>卡接口、红外发送调制功能的<span>UART</span>、支持红外唤醒功能<span></span></p>\n<p class=\"MsoNormal\">》程序移植便利，功能强大、资源丰富<span></span></p>\n<p class=\"MsoNormal\" style=\"margin-left:10.5pt;text-indent:-10.5pt;\">》高可靠硬件代码保护机制，有效保护用户程序<span></span></p>\n<p class=\"MsoNormal\">》支持<span>C</span>语言，无需使用任何汇编代码<span></span></p>\n<p class=\"MsoNormal\"><b><span>&nbsp;</span></b></p>\n<p class=\"MsoNormal\"><b>技术参数：</b><span> </span></p>\n<p class=\"MsoNormal\">》采用冯 · 诺依曼架构，单总线接口<span></span></p>\n<p class=\"MsoNormal\">》<span>Thumb</span>指令集，高效、高代码密度<span></span></p>\n<p class=\"MsoNormal\">》程序存储器：<span>32KB~64KB(FLASH)</span></p>\n<p class=\"MsoNormal\" style=\"margin-left:10.5pt;text-indent:-10.5pt;\">》数据存储器：<span>8KB(SRAM)</span>，可配置<span>Data FLASH</span></p>\n<p class=\"MsoNormal\" style=\"margin-left:10.5pt;text-indent:-10.5pt;\">》集成丰富的<span>32</span>位外设：多路<span>PWM</span>，多路<span>UART</span>，<span>I2C</span>，<span>SPI</span>，<span>LCDC/LEDC</span></p>\n<p class=\"MsoNormal\">》<span>12-bit ADC</span>，<span>RTC</span>等<span></span></p>\n<p class=\"MsoNormal\">》待机功耗：<span>5uA/20uA</span></p>\n<p class=\"MsoNormal\">》工作电压：<span>2.0V~5.5V</span></p>\n</td>\n</tr>\n</tbody>\n</table>\n</p>\n<br />','',4,',1,4,12,',3,20,'product','0','',0,0,'','2016-01-28 16:39:37',0,0,'','0','zh-cn'),(13,'2.4Hz','','','','',5,',1,5,13,',3,10,'product','0','',0,0,'','2016-01-28 16:39:59',0,0,'','0','zh-cn'),(14,'SUB-1G','','','','',5,',1,5,14,',3,20,'product','0','',0,0,'','2016-01-28 16:39:59',0,0,'','0','zh-cn'),(15,'计量','','','<table style=\"width:100%;\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\" class=\"table table-kindeditor ke-zeroborder table-borderless \"><tbody><tr><td><p style=\"vertical-align:baseline;\"><img src=\"/data/upload/201603/f_e5b4f1175d55e592849208dd3d3e79d3.jpg\" alt=\"\" /></p>\n</td>\n<td><p class=\"MsoNormal\"><b>应用领域</b>：<span></span></p>\n<p class=\"MsoNormal\">电表、智能插排、充电桩<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\"><b>应用优势：<span></span></b></p>\n<p class=\"MsoNormal\">支持无功和零线计量、支持防窃电功能、支持软件校表<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\"><b>技术参数：<span></span></b></p>\n<p class=\"MsoNormal\" style=\"margin-left:10.5pt;text-indent:-10.5pt;\">》<span>SSOP24</span>封装、有功误差小于<span>0.1%</span>，动态范围为<span>3000</span>：<span>1&nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"margin-left:10.5pt;text-indent:-10.5pt;\">》两路电流和一路电压有效值误差小于<span>0.2%</span>，动态范围为<span>1000</span>：<span>1&nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"margin-left:10.5pt;text-indent:-10.5pt;\">》电参量测量：电流<span>/</span>电压有效值、平均有功功率<span>/</span>视在功率、平均无功功率<span></span></p>\n<p class=\"MsoNormal\">》电压频率、功率因数和相角<span style=\"line-height:1.53846;background-color:transparent;\"></span></p>\n</td>\n</tr>\n<tr><td><br />\n</td>\n<td><br />\n</td>\n</tr>\n</tbody>\n</table>\n<br />','',6,',1,6,15,',3,10,'product','0','',0,0,'','2016-01-28 16:40:11',0,0,'','0','zh-cn'),(84,'联系我们','','','','',0,',84,',1,50,'article','0','',0,0,'','2016-03-06 23:40:15',0,0,'','0','zh-cn'),(17,'TK','','','<table style=\"width:100%;\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\" class=\"table table-kindeditor ke-zeroborder table-borderless \"><tbody><tr><td><p style=\"vertical-align:baseline;\"><img src=\"/data/upload/201603/f_60cf0268f375a00c5012cb7aaec6db47.jpg\" alt=\"\" width=\"180\" height=\"321\" title=\"\" align=\"\" /></p>\n</td>\n<td><p style=\"vertical-align:baseline;\"><b>应用优势：</b></p>\n<p class=\"MsoNormal\">超强的抗干扰设计，具有防水能力，在水溅、水漫、水淹、水汽、油渍等干扰下仍能正常触摸操作；</p>\n<p class=\"MsoNormal\">能在各种环境下准确识别人手指的触摸。<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\"><b>技术参数：<span></span></b></p>\n<p class=\"MsoNormal\" style=\"margin-left:10.5pt;text-indent:-10.5pt;\">