br />\n</p>\n<p>课程设计</p>\n<p><br />\n</p>\n<p>课题研发</p>\n<p><br />\n</p>\n<p>校园技术讲座</p>\n<p><br />\n</p>\n竞赛支持&nbsp;<br />\n<br />','',28,',28,35,',2,60,'article','0','',0,0,'','2016-02-14 11:16:25',0,0,'','0','zh-cn'),(36,'白色家电','','','','',22,',2,22,36,',3,10,'article','0','',0,0,'','2016-02-15 15:02:43',0,0,'','0','zh-cn'),(37,'小家电','','','','',22,',2,22,37,',3,20,'article','0','',0,0,'','2016-02-15 15:02:43',0,0,'','0','zh-cn'),(39,'安定器','','','','',23,',2,23,39,',3,10,'article','0','',0,0,'','2016-02-15 15:03:05',0,0,'','0','zh-cn'),(40,'控制器','','','','',23,',2,23,40,',3,20,'article','0','',0,0,'','2016-02-15 15:03:05',0,0,'','0','zh-cn'),(93,'移动电源','','','','',22,',2,22,93,',3,30,'article','0','',0,0,'','2016-03-07 00:33:30',0,0,'','0','zh-cn'),(42,'控制器','','','','',24,',2,24,42,',3,10,'article','0','',0,0,'','2016-02-15 15:03:32',0,0,'','0','zh-cn'),(43,'充电器','','','','',24,',2,24,43,',3,20,'article','0','',0,0,'','2016-02-15 15:03:32',0,0,'','0','zh-cn'),(44,'UPS电源','','','','',24,',2,24,44,',3,30,'article','0','',0,0,'','2016-02-15 15:03:32',0,0,'','0','zh-cn'),(45,'SMART产品','','','','',0,',45,',1,10,'forum','0','',0,0,'','2016-02-16 17:36:18',0,0,'','0','zh-cn'),(46,'测试版块','','','','',0,',46,',1,20,'forum','0','',0,0,'','2016-02-16 17:36:52',0,0,'','0','zh-cn'),(47,'MCU产品','','','大家来聊一聊mcu产品吧！','',45,',45,47,',2,10,'forum','0','',1,3,'test','2016-03-02 22:37:08',1,3,'','0','zh-cn'),(48,'文档下载','','','','',0,',48,',1,70,'article','0','',0,0,'','2016-02-28 13:45:26',0,0,'','0','zh-cn'),(49,'数据手册','','','','',48,',48,49,',2,10,'article','0','',0,0,'','2016-02-28 13:52:28',0,0,'','0','zh-cn'),(50,'应用手册','','','','',48,',48,50,',2,20,'article','0','',0,0,'','2016-02-28 13:52:28',0,0,'','0','zh-cn'),(51,'技术手册','','','','',48,',48,51,',2,30,'article','0','',0,0,'','2016-02-28 13:52:28',0,0,'','0','zh-cn'),(52,'集成开发环境','','','<p><span style=\"line-height:1.57143;\"><br />\n</span></p>\n<p><span style=\"line-height:1.57143;\">iDesigner是由我司自主研发的新一代嵌入式集成开发环境，既有PC软件开发工具界面美观、功能强大的特点，也对嵌入式应用开发进行个性化定制。</span></p>\n<p><span style=\"line-height:1.57143;\">&nbsp;iDesigner集成了动态语言分析器、HRCC工具链、HRDebugEngine调试器等工具，以支持丰富的编辑、编译、仿真、调试功能。后续还将集成编程工具，以及支持32位芯片的开发功能。</span></p>\n<p><span style=\"line-height:1.57143;\"><br />\n</span></p>\n<p><span style=\"line-height:1.57143;\"><strong>C语言编译工具链</strong></span></p>\n<p>HRCC是根据HR系列MCU芯片架构特点自主研发了C语言交叉编译工具链，由五个工具组成：HRCC（C语言交叉编译器）、HASM（汇编编译器）、HLINK（链接器）、HDASM（反汇编器）、HLIB（库生成器）。<br />\n<br />\n特点如下：<br />\n》完整的语言定义：充分兼顾C89标准与嵌入式应用需求，追求功能与效率的完美平衡<br />\n》丰富的目标机支持：支持HR全系列芯片，包括66条指令集、79条指令集的HR7P系列，以及ARM&reg; Cortex™-M0 HR8P系列，同时正在陆续增加对其它指令集的芯片的支持<br />\n》优化生成技术：与上海东软载波微电子有限公司的MCU架构完美融合，致力于生成可靠、高效的目标代码<br />\n》创新的核心技术：结合编译器领域前沿的学术研究成果，在架构设计、类型系统、优化技术、代码生成等方面都有创新与发展</p>\n<p><br />\n</p>\n<p>示例图：<br />\n<img width=\"600\" height=\"415\" alt=\"\" src=\"http://www.essemi.com/uploadfile/2014/0415/20140415062637607.jpg\" /><br />\n&nbsp;<img src=\"/data/upload/201603/f_9aef8ede6d536f1a74a8497faf570f44.jpg\" alt=\"\" /></p>\n<p><br />\n</p>\n<div>&nbsp; &nbsp; &nbsp;&nbsp;首次安装iDesigner的用户需要首先安装运行环境，请依次安装.Net Framework4.0、.Net Framework4.0中文补丁包、Visual Studio 2010 Shell (Isolated)。<br />\n&nbsp;</div>\n<div>&nbsp; &nbsp; &nbsp; iDesigner4.1版本发布，优化项目树管理，有效提升8位调试器性能，同时支持32位芯片开发。</div>\n<p><br />\n</p>','',3,',3,52,',2,10,'article','0','',0,0,'','2016-02-28 17:55:18',0,0,'','0','zh-cn'),(53,'开发工具','','','','',3,',3,53,',2,20,'article','0','',0,0,'','2016-02-28 17:55:18',0,0,'','0','zh-cn'),(54,'培训中心','','','','',3,',3,54,',2,30,'article','0','',0,0,'','2016-02-28 17:55:18',0,0,'','0','zh-cn'),(55,'应用文档','','','','',3,',3,55,',2,40,'article','0','',0,0,'','2016-02-28 17:55:18',0,0,'','0','zh-cn'),(56,'工具选型','','','','',53,',3,53,56,',3,10,'article','0','',0,0,'','2016-02-28 17:58:07',0,0,'','0','zh-cn'),(57,'仿真器','','','<p><span style=\"color:#666666;font-family:Arial;font-size:12px;line-height:25px;\"><br />\n</span></p>\n<p><span style=\"color:#666666;font-family:Arial;font-size:12px;line-height:25px;\">&nbsp; &nbsp; &nbsp; &nbsp; 实时仿真器ICE是SHIC为HR系列芯片推出的一款具备多款芯片综合仿真功能的仿真器。它通过仿真器内置的仿真芯片，实时监控MCU运行数据和工作状态，满足用户对于MCU开发的需求。</span></p>\n<p><span style=\"color:#666666;font-family:Arial;font-size:12px;line-height:25px;\"><br />\n</span></p>\n<span style=\"color:#666666;font-family:Arial;font-size:12px;line-height:25px;\">&nbsp; &nbsp; &nbsp; <strong>它具有如下特点：</strong><br />\n&nbsp; &nbsp; &nbsp; - 支持USB2.0通信方式；<br />\n&nbsp; &nbsp; &nbsp; - 完全仿真目标芯片，不占用目标芯片的资源；<br />\n&nbsp; &nbsp; &nbsp; - 全空间硬件断点，不受任何条件限制；<br />\n&nbsp; &nbsp; &nbsp; - 当CPU停止执行目标系统的程序后，可显示目标芯片的所有寄存器值、PC值及堆栈值，并可由用户修改文件寄存器值和PC值；<br />\n&nbsp; &nbsp; &nbsp; - 支持用户板复位功能；<br />\n&nbsp; &nbsp; &nbsp; - 跟踪器功能：以总线周期为单位，实时记录CPU仿真运行过程中，总线上发生的事件；<br />\n&nbsp; &nbsp; &nbsp; - 可控的晶振时钟：由用户在软件界面上设定仿真晶振频率，保证了时钟电路准确性和稳定性，增加了用户设计的灵活性；<br />\n&nbsp; &nbsp; &nbsp; - 单步运行功能；<br />\n&nbsp; &nbsp; &nbsp; - 全速运行功能；<br />\n&nbsp; &nbsp; &nbsp; - 暂停运行功能；<br />\n</span><p><span style=\"color:#666666;font-family:Arial;font-size:12px;line-height:25px;\"> &nbsp; &nbsp; &nbsp; - 复位功能。</span></p>\n<p><span style=\"color:#666666;font-family:Arial;font-size:12px;line-height:25px;\"><br />\n</span></p>\n<span style=\"color:#666666;font-family:Arial;font-size:12px;line-height:25px;\"></span>','',53,',3,53,57,',3,20,'article','0','',0,0,'','2016-02-28 17:58:07',0,0,'','0','zh-cn'),(58,'编程器','','','<p><img src=\"/data/upload/201603/f_769096021f9be614f1f0fa52bf4ff035.jpg\" alt=\"\" /></p>\n<p><img src=\"/data/upload/201603/f_99d48f45478695f57918f40b8f82478d.jpg\" alt=\"\" /></p>','',53,',3,53,58,',3,30,'article','0','',0,0,'','2016-02-28 17:58:07',0,0,'','0','zh-cn'),(59,'学习板','','','<p><br />\n</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;为了有助于满足用户快速熟悉芯片特点，评估芯片功能，学习使用方法，以及进行开发调试的需求，我司可提供各种通用或专用芯片的演示开发板。</p>\n<p><span style=\"line-height:1.57143;\"><br />\n</span></p>\n<p><span style=\"line-height:1.57143;\"><strong><span style=\"font-size:16px;\">HRSDK</span></strong><span style=\"font-size:16px;\">&nbsp;</span><span style=\"font-weight:700;font-size:16px;\">MCU开发板</span></span></p>\n<p><span style=\"line-height:1.57143;\">&nbsp; &nbsp; &nbsp;&nbsp;通用MCU开发板是针对东软载波微电子MCU系列多款典型芯片设计的开发套件，由硬件外围电路板、核心MCU板和丰富的软件例程包组成，演示功能实现了按键、蜂鸣、LED、LCD、I2C、SPI、UART、IrDA等常见的基本应用。</span></p>\n<p style=\"text-align:center;\"><img src=\"/data/upload/201603/f_3402ac56bc1db7c37a10cf9411dc5f86.jpg\" alt=\"\" width=\"600\" height=\"364\" title=\"\" align=\"\" /></p>\n<p style=\"text-align:left;\"><br />\n</p>\n<p style=\"text-align:left;\"><strong><span style=\"font-size:16px;\">RF学习版</span></strong></p>\n<p style=\"text-align:left;\"><br />\n</p>\n<p class=\"MsoNormal\">》图形化操作界面，便于用户入门 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style=\"line-height:1.57143;\">》基于寄存器的功能配置</span></p>\n<p class=\"MsoNormal\">》多种演示模式 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span style=\"line-height:1.57143;\">》提供信道侦听等便捷开发功能</span></p>\n<p class=\"MsoNormal\">》可升级为大批量自动测试工具</p>\n<p class=\"MsoNormal\"><br />\n</p>\n<p><br />\n</p>\n<p><br />\n</p>','',53,',3,53,59,',3,40,'article','0','',0,0,'','2016-02-28 17:58:07',0,0,'','0','zh-cn'),(60,'在线论坛','','','','',3,',3,60,',2,60,'article','0','',0,0,'','2016-02-29 23:52:28',0,0,'http://cimic.k28.cn/forum/','0','zh-cn'),(61,'解决方案','','','展示您的解决方案！','',45,',45,61,',2,30,'forum','0','',0,0,'','2016-03-02 22:23:55',0,0,'','0','zh-cn'),(62,'会员聊天','','','天南地北大家聊！','',45,',45,62,',2,20,'forum','0','',0,0,'test','2016-03-02 22:40:09',2,4,'','0','zh-cn'),(63,'123','','','','',46,',46,63,',2,10,'forum','0','',0,0,'test','2016-03-07 14:47:13',3,0,'','0','zh-cn'),(64,'发展历程','','','<p style=\"text-align:center;\"><img src=\"/data/upload/201603/f_f39a8c6a49bcfffa9e04e161851b9954.jpg\" alt=\"\" /></p>','',30,',28,30,64,',3,10,'article','0','',0,0,'','2016-03-05 12:31:42',0,0,'','0','zh-cn'),(65,'企业文化','','','','',30,',28,30,65,',3,20,'article','0','',0,0,'','2016-03-05 12:31:42',0,0,'','0','zh-cn'),(66,'资质荣誉','','','<p><br />\n</p>\n<p>立足于对自主知识产权的不懈追求和开发创新的设计理念，凭借经验丰富的管理和技术团队，公司自成立以来取得了多项技术资格和技术成果的认定。</p>\n<table style=\"width:100%;\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\" class=\"table table-kindeditor ke-zeroborder table-borderless \"><tbody><tr><td width=\"60%\"><img src=\"/data/upload/201603/f_c4d285282a3b07c1128cf63ef727f359.jpg\" alt=\"\" /><br />\n</td>\n<td width=\"40%\"><p class=\"MsoNormal\" style=\"text-align:center;\"><img src=\"/data/upload/201603/f_0ea6b641893ffe29ae92ed1d6df7fbd6.jpg\" alt=\"\" /></p>\n</td>\n</tr>\n<tr><td><br />\n</td>\n<td><p class=\"MsoNormal\"><img src=\"/data/upload/201603/f_3fe24687d048e30cb18801b4bb185b34.jpg\" alt=\"\" /></p>\n</td>\n</tr>\n</tbody>\n</table>','',30,',28,30,66,',3,30,'article','0','',0,0,'','2016-03-05 12:31:42',0,0,'','0','zh-cn'),(67,'研发成果','','','<p><br />\n</p>\n<p>&nbsp; &nbsp; &nbsp; 上海东软载波微电子有限公司始终坚持自主创新，立足于开发创新的芯片架构和独特的设计方法。对自主知识产权的不懈追求是我们为客户创造价值的源泉。至今，公司已取得了多项技术专利、集成电路布图设计版权和政府认定科技成果。</p>\n<p><br />\n</p>\n<p>&nbsp;110项有效专利，其中31项授权发明</p>\n<p><br />\n</p>\n<p>&nbsp;54项集成电路布图设计版权登记</p>\n<p><br />\n</p>\n&nbsp;4项政府认定科技成果,5项政府认定高新技术成果转换项目<br />','',30,',28,30,67,',3,40,'article','0','',0,0,'','2016-03-05 12:31:42',0,0,'','0','zh-cn'),(68,'体系认证','','','<p><span style=\"color:#666666;font-family:Arial;font-size:12px;line-height:25px;\"><br />\n</span></p>\n<p><span style=\"color:#666666;font-family:Arial;font-size:12px;line-height:25px;\">上海东软载波微电子有限公司依照ISO9001的要求建立管理体系。公司按照以下时间表进行体系认证。</span></p>\n<p><span style=\"color:#666666;font-family:Arial;font-size:12px;line-height:25px;\"><img src=\"/data/upload/201603/f_82fe38bed640e1e49cfa7dac580d852f.jpg\" alt=\"\" /><br />\n</span></p>','',33,',28,33,68,',3,10,'article','0','',0,0,'','2016-03-05 13:30:13',0,0,'','0','zh-cn'),(69,'质量方针','','','','',33,',28,33,69,',3,20,'article','0','',0,0,'','2016-03-05 13:30:13',0,0,'','0','zh-cn'),(70,'可靠性监控','','','<p><br />\n</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;上海东软载波微电子有限公司建立程序确保产品的可靠性符合客户的要求。公司依据AEC-Q100的要求对产品的可靠性进行验证。</p>\n<p><br />\n</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;可靠性验证项目主要分为六组：</p>\n<p><br />\n</p>\n<p>&nbsp; &nbsp; &nbsp; Group A: 环境应力加速验证Accelerated Environment Stress Tests</p>\n<p><br />\n</p>\n<p>&nbsp; &nbsp; &nbsp; Group B: 加速寿命模拟验证 Accelerated Lifetime Simulation Tests</p>\n<p><br />\n</p>\n<p>&nbsp; &nbsp; &nbsp; Group C: 封装验证 Package Assembly Integrity Tests</p>\n<p><br />\n</p>\n<p>&nbsp; &nbsp; &nbsp; Group D: 芯片制造可靠性验证 Die Fabrication Reliability Tests</p>\n<p><br />\n</p>\n<p>&nbsp; &nbsp; &nbsp; Group E: 电性验证 Electrical Verification Tests</p>\n<p><br />\n</p>\n<p>&nbsp; &nbsp; &nbsp; Group F: 失效筛选验证 Defect Screening Tests</p>\n<p><br />\n</p>\n<p>&nbsp; &nbsp; &nbsp; Group G: 空腔体封装综合测试 Cavity Package Integrity Tests（不适用）</p>\n<p><br />\n</p>\n<p><img src=\"/data/upload/201603/f_c262e219aba70781227a4096655f6d7c.jpg\" alt=\"\" /></p>','',33,',28,33,70,',3,30,'article','0','',0,0,'','2016-03-05 13:30:13',0,0,'','0','zh-cn'),(71,'失效分析','','','<p><br />\n</p>\n<p>&nbsp; &nbsp; &nbsp; 上海东软载波微电子有限公司致力于满足客户对于产品性能、质量以及可靠性等方面的要求，采取措施实现对产品的持续改善。</p>\n<p><br />\n</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;公司将充分利用资源对失效产品进行细致深入的分析，确定失效模式和失效机理，提出改善措施以及预防措施，防止这种失效模式和失效机理重复出现。</p>\n<p><br />\n</p>\n<p><img src=\"/data/upload/201603/f_9718edc3d61125db4d9e17975d6efbd7.jpg\" alt=\"\" /></p>','',33,',28,33,71,',3,40,'article','0','',0,0,'','2016-03-05 13:30:13',0,0,'','0','zh-cn'),(72,'体系认证','','','','',34,',28,34,72,',3,10,'article','0','',0,0,'','2016-03-05 13:31:23',0,0,'','0','zh-cn'),(73,'环境方针','','','','',34,',28,34,73,',3,20,'article','0','',0,0,'','2016-03-05 13:31:23',0,0,'','0','zh-cn'),(74,'RoHs报告','','','','',34,',28,34,74,',3,30,'article','0','',0,0,'','2016-03-05 13:31:23',0,0,'','0','zh-cn'),(75,'环境承诺','','','','',34,',28,34,75,',3,40,'article','0','',0,0,'','2016-03-05 13:31:23',0,0,'','0','zh-cn'),(76,'社会招聘','zhaopin','','','',32,',28,32,76,',3,10,'article','0','',0,0,'','2016-03-05 16:49:0