/*Table structure for table `es_consulting` */

DROP TABLE IF EXISTS `es_consulting`;

CREATE TABLE `es_consulting` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `account` char(30) NOT NULL DEFAULT '',
  `realname` char(30) NOT NULL DEFAULT '',
  `email` char(90) NOT NULL DEFAULT '',
  `mobile` char(11) NOT NULL DEFAULT '',
  `phone` char(20) NOT NULL DEFAULT '',
  `company` varchar(255) NOT NULL COMMENT '销售服务单位',
  `address` char(120) NOT NULL DEFAULT '',
  `visits` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `ip` char(15) NOT NULL DEFAULT '',
  `browser` varchar(100) NOT NULL,
  `needtype` varchar(100) DEFAULT NULL COMMENT '需求类型',
  `application` varchar(255) DEFAULT NULL COMMENT '应用',
  `product` varchar(100) DEFAULT '' COMMENT '产品',
