  `tooltype` varchar(100) DEFAULT '' COMMENT '工具类型',
  `need` text COMMENT '用户需求',
  `addedDate` datetime DEFAULT NULL COMMENT '创建时间',
  `buyDate` datetime DEFAULT NULL COMMENT '购买时间',
  `lang` char(30) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `lang` (`lang`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

