/*Table structure for table `es_file` */

DROP TABLE IF EXISTS `es_file`;

CREATE TABLE `es_file` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `pathname` char(200) NOT NULL,
