/*Table structure for table `es_message` */

DROP TABLE IF EXISTS `es_message`;

CREATE TABLE `es_message` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `type` char(20) NOT NULL,
  `objectType` varchar(30) NOT NULL DEFAULT '',
