/*Table structure for table `es_product_attr` */

DROP TABLE IF EXISTS `es_product_attr`;

CREATE TABLE `es_product_attr` (
  `id` smallint(5) unsigned NOT NULL AUTO_INCREMENT COMMENT '属性ID',
  `category` smallint(5) unsigned NOT NULL COMMENT '分类ID',
  `name` varchar(100) NOT NULL COMMENT '属性名称',
  `is_delete` enum('y','n') NOT NULL DEFAULT 'n' COMMENT '是否删除',
  `lang` char(30) NOT NULL COMMENT '语言类型',
  PRIMARY KEY (`id`),
  KEY `lang` (`lang`)
