/*Table structure for table `es_survey` */

DROP TABLE IF EXISTS `es_survey`;

CREATE TABLE `es_survey` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `user_id` mediumint(8) unsigned DEFAULT '0' COMMENT '会员ID',
  `parent` mediumint(8) unsigned DEFAULT '0' COMMENT '父ID',
  `number` varchar(150) DEFAULT NULL COMMENT '编号',
  `theme` varchar(255) DEFAULT NULL COMMENT '项目大类标题',
  `title` varchar(255) DEFAULT NULL COMMENT '调查项目标题',
  `weight` varchar(255) DEFAULT NULL COMMENT '权重',
  `content` varchar(255) DEFAULT NULL COMMENT '调查项目内容',
  `type` varchar(30) DEFAULT NULL COMMENT '内容类型',
  `addedDate` datetime DEFAULT NULL COMMENT '添加时间',
  `beginDate` datetime DEFAULT NULL COMMENT '开始时间',
  `endDate` datetime DEFAULT NULL COMMENT '结束时间',
  `status` varchar(20) DEFAULT 'normal' COMMENT '状态',
  `intro` text,
  `lang` char(30) NOT NULL DEFAULT 'zh-cn',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=15 DEFAULT CHARSET=utf8;

