insert  into `es_survey`(`id`,`user_id`,`parent`,`number`,`theme`,`title`,`weight`,`content`,`type`,`addedDate`,`beginDate`,`endDate`,`status`,`intro`,`lang`) values (1,0,0,NULL,NULL,'终端客户客户满意度调查',NULL,NULL,'zd','2016-03-14 14:05:44','2016-03-14 14:04:00','2016-05-31 23:55:00','on','尊敬的客户，您好！<br />\n&nbsp; &nbsp; 上海东软载波微电子有限公司注重于研发具有高抗干扰性、高可靠性的通用型8位/32位MCU及专用型微控制器产品。产品融合了高性能与兼容性的特点。打造了包括安全芯片（S）、通用MCU（M）、专用芯片（A）、射频无线（R）及触控（T）在内的SMART产品线。多种产品的组合使用为客户提供高性价比的整体解决方案。可广泛应用于智能家居、白色家电、小家电、汽车电子、工业控制、智能电表等领域。<br />\n<br />\n&nbsp; &nbsp; 作为您的合作伙伴，我们竭力满足您的需求。为此，我们每年进行一次客户满意度调查。希望您能通过简短的问卷表达您对我们整体服务的感受。感谢您的参与,这有助于我们服务质量的持续改进,为您提供更专业、优质的服务体验。再次感谢您对我们工作的支持!<br />\n&nbsp; &nbsp; 您的评价和关注非常重要！占用您宝贵时间填写我们的客户满意度调查表，并请于 &nbsp; &nbsp;2015年12月15日 &nbsp; &nbsp;前反馈。<br />','zh-cn'),(2,0,0,NULL,NULL,'代理商、方案设计公司满意度调查',NULL,NULL,'dls','2016-03-14 14:11:21','2016-03-14 14:05:00','2016-05-31 23:55:00','on','尊敬的客户，您好！<br />\n&nbsp; &nbsp; 上海东软载波微电子有限公司注重于研发具有高抗干扰性、高可靠性的通用型8位/32位MCU及专用型微控制器产品。产品融合了高性能与兼容性的特点。打造了包括安全芯片（S）、通用MCU（M）、专用芯片（A）、射频无线（R）及触控（T）在内的SMART产品线。多种产品的组合使用为客户提供质高性价比的整体解决方案。可广泛应用于智能家居、白色家电、小家电、汽车电子、工业控制、智能电表等领域。<br />\n<br />\n&nbsp; &nbsp; 作为您的合作伙伴，我们竭力满足您的需求。为此，我们每进行一次客户满意度调查。希望您能通过简短的问卷表达您对我们整体服务的感受。感谢您的参与,这有助于我们服务质量的持续改进,为您提供更专业、优质的服务体验。再次感谢您对我们工作的支持!<br />\n&nbsp; &nbsp; 您的评价和关注非常重要！占用您宝贵时间填写我们的客户满意度调查表，并请于 &nbsp;2015 年12月15日 &nbsp;前反馈。<br />','zh-cn'),(3,0,1,NULL,'产品质量-芯片质量','芯片外观','5','','1',NULL,NULL,NULL,'normal',NULL,'zh-cn'),(4,0,1,NULL,'产品质量-芯片质量','产线良率(PCB生产过程中)','5','','1',NULL,NULL,NULL,'normal',NULL,'zh-cn'),(5,0,1,NULL,'产品质量-芯片质量','编程良率(烧录程序)','5','','1',NULL,NULL,NULL,'normal',NULL,'zh-cn'),(6,0,1,NULL,'产品质量-芯片质量','终端产品良率（整机产品至客户端）','5','','1',NULL,NULL,NULL,'normal',NULL,'zh-cn'),(7,0,1,NULL,'产品质量-芯片质量','当年芯片退货次数','5','','2',NULL,NULL,NULL,'normal',NULL,'zh-cn'),(8,0,1,NULL,'产品质量-芯片质量','质量问题是否有重复发生？','0','','14',NULL,NULL,NULL,'normal',NULL,'zh-cn'),(9,0,1,NULL,'开发平台','软件开发环境','3','','1',NULL,NULL,NULL,'normal',NULL,'zh-cn'),(10,0,1,NULL,'开发平台','IDE软件','1','','1'