/*Table structure for table `es_zhaopin` */

DROP TABLE IF EXISTS `es_zhaopin`;

CREATE TABLE `es_zhaopin` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(150) NOT NULL,
  `alias` varchar(100) NOT NULL,
  `keywords` varchar(150) NOT NULL,
  `summary` text NOT NULL,
  `content` text NOT NULL,
  `source` enum('original','copied','translational','article') NOT NULL,
  `copySite` varchar(60) NOT NULL,
  `copyURL` varchar(255) NOT NULL,
  `author` varchar(60) NOT NULL,
  `addedBy` varchar(60) NOT NULL,
  `editor` varchar(60) NOT NULL,
  `addedDate` datetime NOT NULL,
  `editedDate` datetime NOT NULL,
  `status` varchar(20) NOT NULL DEFAULT 'normal',
  `type` varchar(30) NOT NULL,
  `contribution` int(1) NOT NULL DEFAULT '0',
  `views` mediumint(5) unsigned NOT NULL DEFAULT '0',
  `sticky` enum('0','1','2','3') NOT NULL DEFAULT '0',
  `order` smallint(5) unsigned NOT NULL,
  `link` varchar(255) NOT NULL,
  `total_number` smallint(5) DEFAULT NULL COMMENT '人数',
  `regions1` char(255) DEFAULT NULL COMMENT '地区',
  `regions2` char(255) DEFAULT NULL,
  `regions3` char(255) DEFAULT NULL,
  `department` varchar(255) DEFAULT NULL,
  `css` text NOT NULL,
  `js` text NOT NULL,
  `lang` char(30) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `order` (`order`),
  KEY `lang` (`lang`),
  KEY `views` (`views`),
  KEY `sticky` (`sticky`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

/*Data for the table `es_zhaopin` */

insert  into `es_zhaopin`(`id`,`title`,`alias`,`keywords`,`summary`,`content`,`source`,`copySite`,`copyURL`,`author`,`addedBy`,`editor`,`addedDate`,`editedDate`,`status`,`type`,`contribution`,`views`,`sticky`,`order`,`link`,`total_number`,`regions1`,`regions2`,`regions3`,`department`,`css`,`js`,`lang`) values (1,'测试工程师（智能三表）','','','<p style=\"font-family:simsun;\"><br />\n</p>\n<p style=\"font-family:simsun;\">1、独立完成熟悉水、电、气表的系统测试。</p>\n<p style=\"font-family:simsun;\"><br />\n2、独立完成熟悉水、电、气表的芯片测试。</p>\n<p style=\"font-family:simsun;\"><br />\n3、独立完成各类测试板硬件开发。 &nbsp;</p>\n<p style=\"font-family:simsun;\"><br />\n4、对公司客户进行各种支持服务，向公司客户进行产品培训。</p>\n<p style=\"font-family:simsun;\"><br />\n</p>','<p><br />\n</p>\n<p>1、熟悉嵌入式C语言。</p>\n<p><br />\n</p>\n<p>2、熟悉水、电、气表标准，具有独立完成水、电、气表测试能力。</p>\n<p><br />\n</p>\n<p>3、精通office软件；</p>\n<p><br />\n</p>\n<p>4、熟悉示波器/逻辑分析仪/EMC测<span style=\"line-height:1.57143;\">试仪等实验设备；</span></p>\n<p><span style=\"line-height:1.57143;\"><br />\n</span></p>\n<p>5、熟悉Protel/PADS/CAD等电路设计软件；</p>\n<p><br />\n</p>\n6、具有良好的语言和文字表达能力。<br />\n<br />','original','','','admin','admin','admin','2016-02-27 23:41:00','2016-03-06 21:04:12','normal','zhaopin',0,15,'0',0,'',20,'21','22','','研发中心（上海）','','','zh-cn'),(3,'实习生职位','','实习生关键字','实习生实习生实习生实习生岗位职责','实习生任职资格','original','','','admin','admin','','2016-03-08 00:42:00','2016-03-08 00:43:18','normal','zhaopin',0,6,'0',0,'',10,'21','22','39','实习生部门','','','zh-cn'),(5,'高级模拟设计工程师','','','1、负责新模拟IP的定义，仿真，设计； <br />\r\n2、负责模拟IP的数据手册文档更新，编写，维护； <br />\r\n3、负责模拟IP的测试，评价，维护； <br />\r\n4、参与SOC芯片规格定义，芯片测试和量产支持； <br />\r\n5、参与电源管理类IC规格定义,项目开发,芯片测试和量产支持。 <br />','<p><table style=\"width:100%;\" cellpadding=\"2\" cellspacing=\"0\" border=\"1\" class=\"table table-kindeditor \" bordercolor=\"#CCCCCC\"><tbody><tr><td>学历要求<br />\r\n</td>\r\n<td>本科<br />\r\n</td>\r\n<td>年龄要求<br />\r\n</td>\r\n<td>26-30<br />\r\n</td>\r\n</tr>\r\n<tr><td>性别要求<br />\r\n</td>\r\n<td>男</td>\r\n<td>专业要求<br />\r\n</td>\r\n<td>电子类<br />\r\n</td>\r\n</tr>\r\n<tr><td>外语程度要求<br />\r\n</td>\r\n<td>六级<br />\r\n</td>\r\n<td>工作年限要求<br />\r\n</td>\r\n<td>2-5年</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</p>\r\n<p>1、了解半导体器件物理与工艺等相关基础知识；&nbsp;<br />\r\n2、能够独立分析并设计如下模块或其中之一：&nbsp;OP;PGA;OSC;ADC;DAC;PLL;LDO等IP模块；&nbsp;<br />\r\n3、会使用实验室基本测试设备进行IP测试，评价与分析；&nbsp;<br />\r\n4、有低功耗Memory IP （SRAM/ROM）设计经验者优先；<br />\r\n5、有Capless LDO IP设计经验者优先；&nbsp;<br />\r\n6、有高速ADC/DAC IP设计经验者优先；&nbsp;<br />\r\n7、有高精度Sigma-Delta ADC/DAC IP设计经验者优先；&nbsp;<br />\r\n8、有classD PA;DC/DC;AC/DC 设计经验者优先；&nbsp;<br />\r\n9、良好的文档能力，能够高质量撰写各类工作报告；&nbsp;<br />\r\n10、要求具备团队合作精神，自我激励，能够按进度及计划完成任务。&nbsp;</p>','original','','','admin','admin','admin','2016-03-21 01:10:00','2016-03-21 01:16:36','normal','zhaopin',0,6,'0',0,'',2,'21','22','25','MCU事业部','','','zh-cn'),(2,'质量主管','','','<p style=\"font-family:simsun;\"><br />\n</p>\n<p style=\"font-family:simsun;\">1.完善质量组工作管理制度，以及委外品质保证的操作流程与工作手册；</p>\n<p style=\"font-family:simsun;\"><br />\n2.支持有效供应商资源的持续开发与维护，完善合格供应商质量管理体系，改进生产质量控制相关文件，参考行业标准和公司实际营运情况，完善供应商评价体系；促使供应商落实各项质量控制要求，确保生产过程可控，产品质量稳定可靠；</p>\n<p style=\"font-family:simsun;\"><br />\n3. 负责对供应商进行现场稽核，就稽核整改及时跟进，保证委外加工符合公司的产品规范要求；</p>\n<p style=\"font-family:simsun;\"><br />\n4.完善生产品质保证体系，负责客户端质量问题反馈分析与处置，协调分析结果导出的相关行动方案；对委工方造成的损失予以追索赔偿；</p>\n<p style=\"font-family:simsun;\"><br />\n5. 不断加强公司全面质量管理体系的建设，通过培训、宣传、推广、督导等方法落实ISO/TS体系精神，提升全公司质量管理与环境物质保护意识，促进营运健康发展；</p>\n<p style=\"font-family:simsun;\"><br />\n6.负责质量组的日常工作督导，对部门员工进行业务培训和绩效考评，提高整体工作素质与能力，并有规划地进行人才培养。</p>\n<p style=\"font-family:simsun;\"><span style=\"font-family:宋体;\"></span></p>','<p style=\"font-family:simsun;\"><span style=\"font-family:宋体;\"><br />\n</span></p>\n<p style=\"font-family:simsun;\"><span style=\"font-family:宋体;\">1.精通ISO9000以及ISO14001体系要求，具有成功实施认证经验；</span></p>\n<p style=\"font-family:simsun;\"><span style=\"font-family:宋体;\"><br />\n2.有FAB厂、封测厂工艺岗位经验；</span></p>\n<p style=\"font-family:simsun;\"><span style=\"font-family:宋体;\"><br />\n3.有六西格玛质量管理经验者为优；</span></p>\n<p style=\"font-family:simsun;\"><span style=\"font-family:宋体;\"><br />\n4.有IC设计或应用相关经验者为优。 掌握集成电路晶园制造工艺流程、工艺特性、品控要求；</span></p>\n<p style=\"font-family:simsun;\"><span style=\"font-family:宋体;\"><br />\n5.掌握集成电路封装测试设备性能、工艺、材料、品质控制与要求；</span></p>\n<p style=\"font-family:simsun;\"><span style=\"font-family:宋体;\"><br />\n6.对集成电路的应用，及SMT的技术有一定的了解；</span></p>\n<p style=\"font-family:simsun;\"><span style=\"font-family:宋体;\"><br />\n7.对集成电路代工行业及其品保控制的发展有实时动态的了解；</span></p>\n<p style=\"font-family:simsun;\"><span style=\"font-family:宋体;\"><br />\n8.有优秀的协调能力和辩识力，有充分的紧急事态处置能力，能在紧急情况下做出快速判断和准确沟通；</span></p>\n<p style=\"font-family:simsun;\"><span style=\"font-family:宋体;\"><br />\n9.有较好的数据统计与分析能力；</span></p>\n<p style=\"font-family:simsun;\"><span style=\"font-family:宋体;\"><br />\n10.有充分的商务谈判技巧和能力，有引导、把握主题并说服各方统一认知的能力；</span></p>\n<p style=\"font-family:simsun;\"><span style=\"font-family:宋体;\"><br />\n11.坚定的执行力与监控力；</span></p>\n<p style=\"font-family:simsun;\"><span style=\"font-family:宋体;\"><br />\n12.有优秀的口头和书面表达能力。<br />\n<div><br />\n</div>\n</span></p>\n<p style=\"font-family:simsun;\"><span style=\"font-family:宋体;\"></span><span style=\"font-family:宋体;\"></span></p>','original','','','admin','admin','admin','2016-03-05 17:30:00','2016-03-06 21:01:53','normal','zhaopin',0,16,'0',0,'',20,'21','22','','生产营运部','','','zh-cn'),(6,'高级数字设计工程师（MCU）','','','1、协同市场工程师，分析客户需求，编写制定芯片设计规格；<br />\r\n2、负责芯片数字前端设计实现，逻辑综合，时序分析；<br />\r\n3、协同验证工程师，提升验证覆盖率，协同后端设计工程师，优化版图Floorplan；<br />\r\n4、协同模拟电路设计工程师，确定数模接口设计规格；<br />\r\n5、对应用反馈的芯片问题，协同测试工程师进行debug分析；<br />\r\n6、完善芯片设计流程和规范，数字设计模块IP化，提升设计质量和效率。<br />\r\n<br />','<p><table style=\"width:100%;\" cellpadding=\"2\" cellspacing=\"0\" border=\"1\" class=\"table table-kindeditor \" bordercolor=\"#CCCCCC\"><tbody><tr><td>学历要求<br />\r\n</td>\r\n<td>本科以上<br />\r\n</td>\r\n<td>年龄要求<br />\r\n</td>\r\n<td>40岁以下<br />\r\n</td>\r\n</tr>\r\n<tr><td>性别要求<br />\r\n</td>\r\n<td>无</td>\r\n<td>专业要求<br />\r\n</td>\r\n<td>电子相关专业<br />\r\n</td>\r\n</tr>\r\n<tr><td>外语程度要求<br />\r\n</td>\r\n<td>CET-4<br />\r\n</td>\r\n<td>工作年限要求<br />\r\n</td>\r\n<td>5年以上<br />\r\n</td>\r\n</tr>\r\n<tr><td>工作经历要求<br />\r\n</td>\r\n<td colspan=\"3\">具有丰富的芯片数字电路设计和验证经验</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</p>\r\n<p>1、具备扎实的数字电路知识，通信基础知识，信号与系统知识，MCU应用系统知识；<br />\r\n2、精通汇编语言或C语言，掌握shell，perl等脚本语言；<br />\r\n3、精通Verilog语言，System verilog语言，熟练运用仿真和逻辑综合EDA工具；<br />\r\n4、有以下相关经验优先：精通Cortex系列内核SOC芯片设计，掌握UART，USB等通信接口的开发，掌握DSP模块数字设计实现，掌握PHY/MAC层相关协议和电路设计实现，熟悉芯片应用系统领域知识；<br />\r\n5、优秀的职业素养，良好的沟通和协调能力，良好的团队意识和合作精神。</p>','original','','','admin','admin','','2016-03-21 01:16:00','2016-03-21 01:24:55','normal','zhaopin',0,7,'0',0,'',4,'21','22','25','MCU事业部','','','zh-cn');

